import React from 'react';
function AddScreen(prop) {
    return(
    <div className='overlay'>
    <div className='popup'>
    <button class="close" onClick={prop.toggleAdd}>&times;</button>
        <h1>
            hello
        </h1>
    </div>
    </div>
    )
}

export default AddScreen
